import React from 'react';


function App (){

  const menu = ['Watches', 'Bags & Luggage', 'Sun glasses', 
                'Jewellery', 'Wallets']
  return(
    <div>
      <h1>Accessories</h1>
      {menu.map((accessory)=>(
        <p>{accessory}</p>
      ))}
    </div>
  )
}

export default App;
